import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './Home';

function Bookkeep() {
  return (
    <Routes>

      <Route to="test" element={<Home />}></Route>
      <Route to="/bookkeep/test" element={<Home />}></Route>
      <Route to="*" element={<Home />}></Route>
    </Routes>
  );
}

export default Bookkeep;
